import React from "react";


class Home extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            page: 0
        }

    }

    render(){
        return (
        <div className="container">
            <div className="row">
                <div className="">
                    <div></div>
                    <div><h4 className="text-dark">ВкусоДОМ</h4>
                    <h6>Ви фали манџа, сарма...?</h6>
                    <p>Немате време за готвење или ви фали јадењето од мама, мирисот на <span  style={{ color: '#CC5C29'}}>ДОМОТ</span>, вкусот на свежо испечен леб на баба, тогаш се наоѓате на правото место.
                    </p>
                    <p>Ние нудиме домашно зготвени, не многу брзи (за вас брзи) јадења, кои ги правиме со голема љубов и неизмерна посветеност.</p>
                    </div>
                </div>
            </div>
        </div>
        )
    }

}

export default Home;
